import React from "react";

const Header = () => {
  return (
    <div className="header" style={{ backgroundColor: 'blue', color: 'white', padding: '10px', display: 'flex', justifyContent: 'space-between' }}>
      <div className="logo" style={{ display: 'flex', alignItems: 'center' }}>
        <img src="logo.png" alt="Logo" style={{ width: '30px', height: '30px', marginRight: '10px' }} />
        <span>Company Name</span>
      </div>
      <div className="navigation" style={{ display: 'flex', alignItems: 'center' }}>
        <a href="#" style={{ color: 'white', marginRight: '10px', textDecoration: 'none' }}>Home</a>
        <a href="#" style={{ color: 'white', marginRight: '10px', textDecoration: 'none' }}>About Us</a>
        <a href="#" style={{ color: 'white', marginRight: '10px', textDecoration: 'none' }}>Services</a>
        <a href="#" style={{ color: 'white', marginRight: '10px', textDecoration: 'none' }}>Contact</a>
      </div>
    </div>
  );
};

export default Header;
